class App extends React.Component{
  constructor(props){
    super(props);
    this.state={apiResponse:""}
  }
  callAPI(){
    fetch("http://localhost:9000/TestAPI")
    .then(res => res.text())
    .then(res => this.setState({apiResponse: res}));
  }
componentWillMount(){
  this.callAPI();
}
render(){
  return(
    <div>
